import React from "react";
import { Button } from "../components/Button";
import Input from "../components/Input";
import "./Login.css";
import { Link } from "react-router-dom";

const Login = () => {
  return (
    <div className="Login">
      <h1> LOGIN </h1>
      <Link className="link" to="/Signup">
        <h2>Sign up?</h2>
      </Link>
      <form>
        <Input />
        <Input />
        <Button />
      </form>
    </div>
  );
};

export default Login;
